import '../App.css';
import {Route, Router, Routes} from "react-router";
import Survey from "./Survey";


function Home() {
  return (

       <Router >
         <Routes>
          <Route path="/" element={<Survey/>}></Route>

         </Routes>

       </Router>
  );
}

export default Home;
